/// @title Library for storing SVG image of veNFT.
/// @author belbix
library VeLogo {

  /// @dev Return SVG logo of xSHADY
  function tokenURI(uint _tokenId, uint _balanceOf, uint untilEnd, uint _value) public pure returns (string memory output) {
    output = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 600 900" xmlns:xlink="http://www.w3.org/1999/xlink"><style>.base{font-size:40px;}</style><rect fill="#44a465" width="600" height="900"/><path fill="#1B4229" d="M0,900h600V522.2C454.4,517.2,107.4,456.8,60.2,0H0V900z"/><circle fill="#69db7c" cx="385" cy="212" r="120"/><symbol id="image-241a2825d965ea677b3dc22aaea9375b2aeb6193"><image width="100%" height="100%" xlink:href="data:image/png;base64,"></image></symbol><g transform="translate(37.57910645834454 30.260009582668317) rotate(0 86.40756100104954 86.40756100104909)"><use xlink:href="#image-241a2825d965ea677b3dc22aaea9375b2aeb6193" width="173" height="173" opacity="1" x="260" y="85"></use></g>';
    output = string(abi.encodePacked(output, '<text transform="matrix(1 0 0 1 50 464)" fill="#EAECFE" class="base">ID:</text><text transform="matrix(1 0 0 1 50 506)" fill="#6fe783" class="base">', StringLib._toString(_tokenId), '</text>'));
    output = string(abi.encodePacked(output, '<text transform="matrix(1 0 0 1 50 579)" fill="#EAECFE" class="base">Balance:</text><text transform="matrix(1 0 0 1 50 621)" fill="#6fe783" class="base">', StringLib._toString(_balanceOf / 1e18), '</text>'));
    output = string(abi.encodePacked(output, '<text transform="matrix(1 0 0 1 50 695)" fill="#EAECFE" class="base">Until unlock:</text><text transform="matrix(1 0 0 1 50 737)" fill="#6fe783" class="base">', StringLib._toString(untilEnd / 60 / 60 / 24), ' days</text>'));
    output = string(abi.encodePacked(output, '<text transform="matrix(1 0 0 1 50 811)" fill="#EAECFE" class="base">Power:</text><text transform="matrix(1 0 0 1 50 853)" fill="#6fe783" class="base">', StringLib._toString(_value / 1e18), '</text></svg>'));

    string memory json = Base64.encode(bytes(string(abi.encodePacked('{"name": "xSHADY #', StringLib._toString(_tokenId), '", "description": "Locked SHADY tokens", "image": "data:image/svg+xml;base64,', Base64.encode(bytes(output)), '"}'))));
    output = string(abi.encodePacked('data:application/json;base64,', json));
  }
}
